En funksjon som skal utvikle "nok langt nok nok nok langt" er som følge:
```C++
#include <iostream>
#include <string>
#include <sstream>
#include <regex>
using namespace std;
int main() {
    string input_file_name("input.txt");
    string output_file_name("output.txt");
    ifstream input_file(input_file_name);
    ofstream output(output_file_name);
    string line;
    while(getline(input_file, line)) {
        stringstream ss;
        ss << line;
        regex re("[a-zA-Z]+[0-9]+");
        bool found = re.match(ss.str());
        if (!found) {
            cout << line << endl;
        } else {
            cout << ss.str() << endl;
        }
    }
    input_file.close();
    output.close();
    return EXIT_SUCCESS;
}```
